loadScript:
///$tab Main
SET ThousandSep=',';
SET DecimalSep='.';
SET MoneyThousandSep=',';
SET MoneyDecimalSep='.';
SET MoneyFormat='$#,##0.00;($#,##0.00)';
SET TimeFormat='h:mm:ss TT';
SET DateFormat='M/D/YYYY';
SET TimestampFormat='M/D/YYYY h:mm:ss[.fff] TT';
SET MonthNames='Jan;Feb;Mar;Apr;May;Jun;Jul;Aug;Sep;Oct;Nov;Dec';
SET DayNames='Mon;Tue;Wed;Thu;Fri;Sat;Sun';

Activations:
LOAD
    MSISDN,
    City,
    State,
    Region,
    "Activation Date",
    "Activation Month Start",
    ActivationYear,
    ActivationMonth,
    ActivationMonthYear,
    MonthYear,
    "Cease Date",
    "Cease Month",
    "Cease Year",
    "Cease Day",
    "Cease Status",
    "Revenue MonthYear",
    Revenue,
    "Regional Revenue"
FROM [lib://Activations]
(qvd);


Churn:
LOAD
    City,
    "Cease MonthYear",
    CumulativeCease_Count,
    CumulativeActivation_Count,
    Cease_Count,
    Activation_Count,
    Active_Count
FROM [lib://Churn]
(qvd);



Let vToday = Max("Activation Date");
